!async function(){const t=document.getElementById("view-counter");if(t){const e=await fetch("https://us-central1-ut-dts-agrc-gis-utah-gov-prod.cloudfunctions.net/viewcounter",{method:"POST",body:location.href});if(200===e.status){const n=await e.json();n.hasOwnProperty("skip")&&n.skip||(t.innerHTML=`This page has been viewed ${n.count.toLocaleString()} times`)}}}();